import { PostReducer } from "./PostReducer";
import {combineReducers} from "redux";
import { AuthReducer } from "./AuthReducer";
import { UserReducer } from "./UserReducer";

const Reducer = combineReducers({
    Auth:AuthReducer,
    Post:PostReducer,
    User:UserReducer
})

export default Reducer
